(45, 'Giám Đốc Tài Chính', '<p>Thực hiện Mục tiêu chiến lược của Phòng Tài chính - Kế toán</p>\n<p>Tham mưu và xây dựng kế hoạch tài chính theo chiến lược phát triển phù hợp với từng giai đoạn, đảm bảo giải quyết hiệu quả các Mục tiêu của Công ty.\nTham mưu quản lý, sử dụng hiệu quả nguồn vốn cho sản xuất, đầu tư và công tác kế toán; Xây dựng chính sách và kế hoạch phân chia lợi nhuận\nQuản lý tài chính và lập kế hoạch chiến lược</p>\n<p>Lập kế hoạch, chiến lược về tài chính trung hạn, dài hạn đảm bảo nguồn vốn cho tăng trưởng của công ty; Thu xếp vốn, quản lý cơ cấu vốn, phân bổ nguồn vốn phù hợp, hiệu quả; Làm việc với các tổ chức tài chính, ngân hàng để huy động vốn.\nPhân tích hoạt động kinh tế; kiểm soát và giám sát mọi hoạt động tài chính - kế toán; Phân tích tình hình quản lý tài chính, cân đối nguồn vốn, tài sản, công nợ của Công ty, đưa ra các khuyến nghị phòng ngừa rủi ro.\nTham gia thẩm định tài chính hoặc phân tích tài chính cho các dự án đầu tư, đầu tư chiều sâu, đầu tư mở rộng, đầu tư mới hoặc thay thế máy móc, thiết bị, liên doanh, liên kết, đầu tư tài chính, chứng khoáng để đưa ra các đề xuất về việc tối ưu hóa các nguồn lực tài chính và sử dụng hiệu quả vốn đầu tư.\nGiám sát hệ thống kế toán, tài chính, đảm bảo tuân thủ các quy định pháp luật và tiêu chuẩn tài chính kế toán; Thiết lập các hệ thống kiểm soát nội bộ để ngăn ngừa rủi ro tài chính và gian lận trong công ty; Quản lý các hoạt động kiểm toán nội bộ và đối ngoại, đảm bảo tính minh bạch và chính xác của báo cáo tài chính.\nPhân tích chi phí sản xuất, từ đó tối ưu hóa quy trình và cắt giảm chi phí mà không ảnh hưởng đến chất lượng sản phẩm; Cung cấp báo cáo tài chính chính xác và kịp thời cho Ban Tổng giám đốc\nĐảm bảo nguồn vốn cùng các loại tài sản của doanh nghiệp được kiểm soát, sử dụng hợp lý và sinh lợi; Xây dựng chính sách phân chia lợi nhuận hợp lý\nXem xét, đánh giá, kiểm tra và phân tích dự báo hoạt động tài chính kế toán của các bộ phận, hợp đồng, dự án; Duy trì khả năng thanh toán của doanh nghiệp và đảm bảo có đủ nguồn tài chính cho hoạt động của doanh nghiệp\nTổ chức phổ biến, thi hành kịp thời các chế độ, thể lệ tài chính kế toán của Nhà nước, quy chế quản lý tài chính - kế toán của Công ty.\nPhân tích các chính sách, thủ tục, và thông tin về cổ đông của công ty, bao gồm báo cáo thường niên và tạm thời cho các cổ đông và Hội đồng Quản trị, cũng như đề xuất với Chủ tịch về các chính sách, thủ tục hoặc hoạch định về tài chính mới.\nQuản lý kế toán</p>\n<p>Phối hợp và chỉ đạo tổ chức xây dựng hệ thống và kiểm tra, kiểm soát thực hiện công tác kế toán trong công ty\nChỉ đạo và kiểm tra việc lập báo cáo tài chính, báo cáo thống kê, báo cáo quản trị\nTổ chức kiểm tra kế toán, kiểm toán nội bộ, làm việc với kiểm toán chuyên nghiệp, kiểm toán Nhà nước, với các đoàn kiểm tra, thanh tra hoặc với các cơ quan thanh tra, quản lý pháp luật\nQuản lý Nhân sự</p>\n<p>Phụ trách quản lý và chỉ đạo hoạt động của Kế toán trưởng, Phòng Tài chính Kế toán,... trên cơ sở bảo toàn và phát triển vốn Công ty;\nTổ chức, giám sát việc tuân thủ Nội quy lao động, các quy chế, quy định nội bộ của công ty đối với CBCNV; Xây dựng và lãnh đạo đội ngũ tài chính chuyên nghiệp, phát triển kỹ năng của nhân viên để đáp ứng yêu cầu công việc\nXây dựng quy trình, Quy định</p>\n<p>Tham mưu xây dựng, kiện toàn hệ thống các quy chế quản lý nội bộ về công tác tài chính-kế toán phù hợp các quy định của Nhà nước và công ty nhằm nâng cao hiệu quả quản lý nhân sự và công việc\nTham gia xây dựng, cải tiến các Quy trình, Quy định của Công ty</p>\n', 'Thực hiện Mục tiêu chiến lược của Phòng Tài chính - Kế toán\n\nTham mưu và xây dựng kế hoạch tài chính theo chiến lược phát triển phù hợp với từng giai đoạn, đảm bảo giải quyết hiệu quả các Mục tiêu của Công ty.\nTham mưu quản lý, sử dụng hiệu quả nguồn vốn cho sản xuất, đầu tư và công tác kế toán; Xây dựng chính sách và kế hoạch phân chia lợi nhuận\nQuản lý tài chính và lập kế hoạch chiến lược\n\nLập kế hoạch, chiến lược về tài chính trung hạn, dài hạn đảm bảo nguồn vốn cho tăng trưởng của công ty; Thu xếp vốn, quản lý cơ cấu vốn, phân bổ nguồn vốn phù hợp, hiệu quả; Làm việc với các tổ chức tài chính, ngân hàng để huy động vốn.\nPhân tích hoạt động kinh tế; kiểm soát và giám sát mọi hoạt động tài chính - kế toán; Phân tích tình hình quản lý tài chính, cân đối nguồn vốn, tài sản, công nợ của Công ty, đưa ra các khuyến nghị phòng ngừa rủi ro.\nTham gia thẩm định tài chính hoặc phân tích tài chính cho các dự án đầu tư, đầu tư chiều sâu, đầu tư mở rộng, đầu tư mới hoặc thay thế máy móc, thiết bị, liên doanh, liên kết, đầu tư tài chính, chứng khoáng để đưa ra các đề xuất về việc tối ưu hóa các nguồn lực tài chính và sử dụng hiệu quả vốn đầu tư.\nGiám sát hệ thống kế toán, tài chính, đảm bảo tuân thủ các quy định pháp luật và tiêu chuẩn tài chính kế toán; Thiết lập các hệ thống kiểm soát nội bộ để ngăn ngừa rủi ro tài chính và gian lận trong công ty; Quản lý các hoạt động kiểm toán nội bộ và đối ngoại, đảm bảo tính minh bạch và chính xác của báo cáo tài chính.\nPhân tích chi phí sản xuất, từ đó tối ưu hóa quy trình và cắt giảm chi phí mà không ảnh hưởng đến chất lượng sản phẩm; Cung cấp báo cáo tài chính chính xác và kịp thời cho Ban Tổng giám đốc\nĐảm bảo nguồn vốn cùng các loại tài sản của doanh nghiệp được kiểm soát, sử dụng hợp lý và sinh lợi; Xây dựng chính sách phân chia lợi nhuận hợp lý\nXem xét, đánh giá, kiểm tra và phân tích dự báo hoạt động tài chính kế toán của các bộ phận, hợp đồng, dự án; Duy trì khả năng thanh toán của doanh nghiệp và đảm bảo có đủ nguồn tài chính cho hoạt động của doanh nghiệp\nTổ chức phổ biến, thi hành kịp thời các chế độ, thể lệ tài chính kế toán của Nhà nước, quy chế quản lý tài chính - kế toán của Công ty.\nPhân tích các chính sách, thủ tục, và thông tin về cổ đông của công ty, bao gồm báo cáo thường niên và tạm thời cho các cổ đông và Hội đồng Quản trị, cũng như đề xuất với Chủ tịch về các chính sách, thủ tục hoặc hoạch định về tài chính mới.\nQuản lý kế toán\n\nPhối hợp