(47, 'Senior Front-End Developer', '<p><strong>Mô tả công việc</strong>\n• Hỗ trợ phát triển sử dụng UI Dev\n• Kỹ năng với Vue.js, Javascript, Typescript, HTML, css,.\n• Có kinh nghiệm về Lego Enterprise framework và OPUS\n• Diễn giải, phân tích và triển khai các yêu cầu của khách hàng\n• Thực hiện xác minh chất lượng bao gồm đánh giá mã, kiểm tra mã, kiểm tra hiệu suất, v.v.\n<strong>Yêu cầu ứng viên</strong>\n• Bằng cử nhân.\n• Có ít nhất 8 năm kinh nghiệm (lĩnh vực liên quan).\n• Làm việc để phù hợp với tiêu chuẩn web và khả năng truy cập của những gì các nhà thiết kế web thiết kế.\n• Tạo và chỉnh sửa trang web thông qua công việc thiết kế web và mã hóa.\n• Tạo và chỉnh sửa trang web thông qua công việc thiết kế web và mã hóa.\n• Có kinh nghiệm phát triển trang sử dụng vue.js trên thiết bị di động (Android, IOS – Hybrid app)\n<strong>Quyền lợi</strong></p>\n<ul>\n<li>Lương thỏa thuận</li>\n<li>Lương 100% trong thời gian thử việc 2 tháng</li>\n<li>Bảo hiểm toàn phần ngay từ thời gian thử việc</li>\n<li>Gói bảo hiểm sức khỏe cao cấp &amp; Khám sức khỏe 1 lần/năm</li>\n<li>3 lần được thưởng</li>\n<li>Ngân sách hàng năm cho đào tạo cá nhân &amp; Tài khoản Udemy</li>\n<li>Cơ hội đào tạo ở nước ngoài</li>\n<li>Nhiều hoạt động nội bộ: gắn kết nhóm, đào tạo nhóm, ...</li>\n<li>Quà tặng cho mỗi nhân viên vào các ngày 30/4, 1/5; 2/9.... (bằng tiền mặt)</li>\n<li>Thưởng cho nhân viên có chứng chỉ tiếng Anh hoặc tiếng Hàn hoặc chứng chỉ Software Test</li>\n<li>Thời gian check in linh hoạt</li>\n</ul>\n', '**Mô tả công việc**\n• Hỗ trợ phát triển sử dụng UI Dev\n• Kỹ năng với Vue.js, Javascript, Typescript, HTML, css,.\n• Có kinh nghiệm về Lego Enterprise framework và OPUS\n• Diễn giải, phân tích và triển khai các yêu cầu của khách hàng\n• Thực hiện xác minh chất lượng bao gồm đánh giá mã, kiểm tra mã, kiểm tra hiệu suất, v.v.\n**Yêu cầu ứng viên**\n• Bằng cử nhân.\n• Có ít nhất 8 năm kinh nghiệm (lĩnh vực liên quan).\n• Làm việc để phù hợp với tiêu chuẩn web và khả năng truy cập của những gì các nhà thiết kế web thiết kế.\n• Tạo và chỉnh sửa trang web thông qua công việc thiết kế web và mã hóa.\n• Tạo và chỉnh sửa trang web thông qua công việc thiết kế web và mã hóa.\n• Có kinh nghiệm phát triển trang sử dụng vue.js trên thiết bị di động (Android, IOS – Hybrid app)\n**Quyền lợi**\n- Lương thỏa thuận\n- Lương 100% trong thời gian thử việc 2 tháng\n- Bảo hiểm toàn phần ngay từ thời gian thử việc\n- Gói bảo hiểm sức khỏe cao cấp & Khám sức khỏe 1 lần/năm\n- 3 lần được thưởng\n- Ngân sách hàng năm cho đào tạo cá nhân & Tài khoản Udemy\n- Cơ hội đào tạo ở nước ngoài\n- Nhiều hoạt động nội bộ: gắn kết nhóm, đào tạo nhóm, ...\n- Quà tặng cho mỗi nhân viên vào các ngày 30/4, 1/5; 2/9.... (bằng tiền mặt)\n- Thưởng cho nhân viên có chứng chỉ tiếng Anh hoặc tiếng Hàn hoặc chứng chỉ Software Test\n- Thời gian check in linh hoạt', 'cong-nghe-thong-tin', 'Hà Nội', '10-15tr', 2, 'nhan-vien', 'fulltime', '3nam', 'nam-post'),
(48, 'Front End Developer ( React.JS )', '<p><strong>Mô tả công việc</strong></p>\n<ul>\n<li>Chịu trách nhiệm phát triển các sản phẩm Web sử dụng ngôn ngữ/công nghệ: React/JavaScript, WebSocket, WebRTC,...</li>\n<li>Xây dựng bộ JavaScript SDK voice/video call dựa trên WebRTC.</li>\n<li>Chuyển đổi thiết kế thành các các giao diện UI/UX thân thiện với người dùng.</li>\n<li>Đảm bảo trải nghiệm người dùng tốt và tương tác mượt mà trên nhiều thiết bị và trình duyệt khác nhau.\n<strong>Yêu cầu ứng viên</strong></li>\n<li>Ít nhất 1 năm kinh nghiệm làm việc với ReactJS trong môi trường phát triển web.</li>\n<li>Thành thạo JavaScript, jQuery, Bootstrap, Typescript, ES6, CSS3, HTML5, ESLint.</li>\n<li>Nắm vững lập trình hướng đối tượng với JavaScript.</li>\n<li>Có kinh nghiệm phát triển và tích hợp RESTful API,.</li>\n<li>Có kinh nghiệm triển khai giao diện web responsive, đảm bảo trải nghiệm người dùng mượt mà trên nhiều loại thiết bị và kích thước màn hình.\n<strong>Quyền lợi</strong></li>\n<li>Lương từ $700 - $2000 (phụ thuộc vào năng lực và kinh nghiệm của bạn, chúng tôi không bao giờ đãi ngộ thấp hơn khả năng của bạn).</li>\n<li>Thưởng theo hiệu quả công việc (hoàn thành milestone, deadline, ...), thưởng năm, các dịp lễ tết.</li>\n<li>Môi trường trẻ, năng động, sáng tạo, hỗ trợ tối đa sự phát triển và công việc của nhân viên.</li>\n<li>Được đào tạo để thường xuyên nâng cao nghiệp vụ. Cơ hội được học hỏi, làm việc với công nghệ mới.</li>\n<li>Được làm việc trong một môi trường chuyên nghiệp với các đối tác nước ngoài.</li>\n<li>Được đóng bảo hiểm và các chế độ khác theo Luật lao động; khám sức khỏe định kỳ hàng năm.</li>\n<li>Được tham gia các câu lạc bộ thể thao: bóng đá, chạy bộ,...</li>\n<li>Được tham dự các buổi đi chơi, dã ngoại, nghỉ mát,...</li>\n</ul>\n', '**Mô tả công việc**\n* Chịu trách nhiệm phát triển các sản phẩm Web sử dụng ngôn ngữ/công nghệ: React/JavaScript, WebSocket, WebRTC,...\n* Xây dựng bộ JavaScript SDK voice/video call dựa trên WebRTC.\n* Chuyển đổi thiết kế thành các các giao diện UI/UX thân thiện với người dùng.\n* Đảm bảo trải nghiệm người dùng tốt và tương tác mượt mà trên nhiều thiết bị và trình duyệt khác nhau.\n**Yêu cầu ứng viên**\n* Ít nhất 1 năm kinh nghiệm làm việc với ReactJS trong môi trường phát triển web.\n* Thành thạo JavaScript, jQuery, Bootstrap, Typescript, ES6, CSS3, HTML5, ESLint.\n* Nắm vững lập trình hướng đối tượng với JavaScript.\n* Có kinh nghiệm phát triển và tích hợp RESTful API,.\n* Có kinh nghiệm triển khai giao diện web responsive, đảm bảo trải nghiệm người dùng mượt mà trên nhiều loại thiết bị và kích thước màn hình.\n**Quyền lợi**\n* Lương từ $700 - $2000 (phụ thuộc vào năng lực và kinh nghiệm của bạn, chúng tôi không bao giờ đãi ngộ thấp hơn khả năng của bạn).\n* Thưởng theo hiệu quả công việc (hoàn thành milestone, deadline, ...), thưởng năm, các dịp lễ tết.\n* Môi trường trẻ, năng động, sáng tạo, hỗ trợ tối đa sự phát triển và công việc của nhân viên.\n* Được đào tạo để thường xuyên nâng cao nghiệp vụ. Cơ hội được học hỏi, làm việc với công nghệ mới.\n* Được làm việc trong một môi trường chuyên nghiệp với các đối tác nước ngoài.\n* Được đóng bảo hiểm và các chế độ khác theo Luật lao động; khám sức khỏe định kỳ hàng năm.\n* Được tham gia các câu lạc bộ thể thao: bóng đá, chạy bộ,...\n* Được tham dự các buổi đi chơi, dã ngoại, nghỉ mát,...', 'cong-nghe-thong-tin', 'Hà Nội', '3-5tr', 3, 'nhan-vien', 'fulltime', '1-nam', 'ca-hai'),
(49, 'Freelancer Front-End Developer (Angular)', '<p>Mô tả công việc\nTham gia xây dựng và phát triển Frontend cho web và mobile sử dụng công nghệ Agular\nĐề xuất giải pháp cho các yêu cầu để hoàn thành công việc đúng tiến độ và chất lượng\nHỗ trợ với các thành viên khác trong nhóm như backend, designer cải tiến sản phẩm liên tục\nHỗ trợ thực hiện các design patterns, tối ưu, caching, bảo mật và tính khả dụng mang lại trải nghiệm mượt mà đơn giản, dễ sử dụng\nHỗ trợ tối ưu hóa giao diện các ứng dụng/trang web để có được tốc độ và hiệu suất tối đa\nCác công việc khác trao đổi cụ thể khi phỏng vấn.\nYêu cầu ứng viên\nTốt nghiệp các chuyên ngành công nghệ thông tin, khoa học máy tính,... hoặc các chuyên ngành có liên quan\nCó kinh nghiệm với lập trình Front-end Angular từ 4 năm trở lên (level Middle trở lên)\nAm hiểu HTML/CSS, biết sử dụng các CSS framework (Bootstrap,..) và tối ưu hoá CSS, HTML, JS theo chuẩn để cải tiến tốc độ.\nCó kiến thức và kinh nghiệm về Session, Token, Cache trình duyệt, web socket, service workers\nQuyền lợi\nMức lương: thỏa thuận upto 250.000đ/h\nHình thức hợp tác: thỏa thuận (ứng viên tùy chọn lương theo giờ hoặc trả theo task, hoặc các hình thức khác ứng viên đề xuất)\nHợp tác lâu dài\nKhối lượng công việc tùy theo giai đoạn cửa dự án</p>\n', 'Mô tả công việc\nTham gia xây dựng và phát triển Frontend cho web và mobile sử dụng công nghệ Agular\nĐề xuất giải pháp cho các yêu cầu để hoàn thành công việc đúng tiến độ và chất lượng\nHỗ trợ với các thành viên khác trong nhóm như backend, designer cải tiến sản phẩm liên tục\nHỗ trợ thực hiện các design patterns, tối ưu, caching, bảo mật và tính khả dụng mang lại trải nghiệm mượt mà đơn giản, dễ sử dụng\nHỗ trợ tối ưu hóa giao diện các ứng dụng/trang web để có được tốc độ và hiệu suất tối đa\nCác công việc khác trao đổi cụ thể khi phỏng vấn.\nYêu cầu ứng viên\nTốt nghiệp các chuyên ngành công nghệ thông tin, khoa học máy tính,... hoặc các chuyên ngành có liên quan\nCó kinh nghiệm với lập trình Front-end Angular từ 4 năm trở lên (level Middle trở lên)\nAm hiểu HTML/CSS, biết sử dụng các CSS framework (Bootstrap,..) và tối ưu hoá CSS, HTML, JS theo chuẩn để cải tiến tốc độ.\nCó kiến thức và kinh nghiệm về Session, Token, Cache trình duyệt, web socket, service workers\nQuyền lợi\nMức lương: thỏa thuận upto 250.000đ/h\nHình thức hợp tác: thỏa thuận (ứng viên tùy chọn lương theo giờ hoặc trả theo task, hoặc các hình thức khác ứng viên đề xuất)\nHợp tác lâu dài\nKhối lượng công việc tùy theo giai đoạn cửa dự án', 'cong-nghe-thong-tin', 'Hà Nội', '3-5tr', 6, 'nhan-vien', 'fulltime', '2-nam', 'ca-hai'),
(50, 'Sales Bất Động Sản ', '<p>Mô tả công việc\nTìm kiếm, khai thác khách hàng có nhu cầu về bất động sản.\nCung cấp, tư vấn đầy đủ chính xác thông tin sản phẩm đáp ứng nhu cầu khách hàng nhằm hoàn thành chỉ tiêu được giao.\nPhát triển mối quan hệ khách hàng và kênh khách hàng mới.\nChăm sóc khách hàng theo chương trình của công ty.\nCác công việc khác theo sự phân công, chỉ đạo của quản lý trực tiếp.\nYêu cầu ứng viên\nTốt nghiệp Trung cấp/Cao đẳng trở lên\nƯu tiên ứng viên đã từng bán các sản phẩm BĐS của Vinhomes\nTối thiểu 01 năm kinh nghiệm trong Bất động sản, Marketing, Tài chính, Ngân hàng, bảo hiểm...\nCó đạo đức tốt, trung thực, tuân thủ kỷ luật và có trách nhiệm cao với công việc</p>\n<p>Thu nhập\nThu nhập khi đạt 100% KPI: Đến 150 triệu VND\nThu nhập tính theo tỷ lệ đạt KPI\nLương cứng: 8 - 15 triệu VND\nLương cứng không phụ thuộc doanh số\nQuyền lợi</p>\n<ul>\n<li>Mức lương hấp dẫn + Thưởng doanh số (lương cứng không phụ thuộc doanh số, thu nhập cao không giới hạn từ 150 triệu/tháng)</li>\n</ul>\n<p>Lương NET 7.000.000 TRIỆU - 15.000.000 TRIỆU\nPhụ Cấp Ăn Trưa 960.000đ\nHoa Hồng nhận NET: 2.7125% &amp; NHANH No1 thị trường\nThưởng nóng lên đến 1%/giao dịch\nThưởng KPI tháng/Quý/Năm</p>\n', 'Mô tả công việc\nTìm kiếm, khai thác khách hàng có nhu cầu về bất động sản.\nCung cấp, tư vấn đầy đủ chính xác thông tin sản phẩm đáp ứng nhu cầu khách hàng nhằm hoàn thành chỉ tiêu được giao.\nPhát triển mối quan hệ khách hàng và kênh khách hàng mới.\nChăm sóc khách hàng theo chương trình của công ty.\nCác công việc khác theo sự phân công, chỉ đạo của quản lý trực tiếp.\nYêu cầu ứng viên\nTốt nghiệp Trung cấp/Cao đẳng trở lên\nƯu tiên ứng viên đã từng bán các sản phẩm BĐS của Vinhomes\nTối thiểu 01 năm kinh nghiệm trong Bất động sản, Marketing, Tài chính, Ngân hàng, bảo hiểm...\nCó đạo đức tốt, trung thực, tuân thủ kỷ luật và có trách nhiệm cao với công việc\n\n\n\nThu nhập\nThu nhập khi đạt 100% KPI: Đến 150 triệu VND\nThu nhập tính theo tỷ lệ đạt KPI\nLương cứng: 8 - 15 triệu VND\nLương cứng không phụ thuộc doanh số\nQuyền lợi\n- Mức lương hấp dẫn + Thưởng doanh số (lương cứng không phụ thuộc doanh số, thu nhập cao không giới hạn từ 150 triệu/tháng)\n\nLương NET 7.000.000 TRIỆU - 15.000.000 TRIỆU\nPhụ Cấp Ăn Trưa 960.000đ\nHoa Hồng nhận NET: 2.7125% & NHANH No1 thị trường\nThưởng nóng lên đến 1%/giao dịch\nThưởng KPI tháng/Quý/Năm', 'bat-dong-san', 'Đà Nẵng', '10-15tr', 3, 'nhan-vien', 'fulltime', '2-nam', 'ca-hai'),
(51, 'Nhân Viên Tư Vấn Căn Hộ', '<p>Mô tả công việc</p>\n<ul>\n<li>\n<p>Tìm kiếm, khai thác khách hàng tiềm năng thông qua các kênh: Quảng cáo, Facebook, Website,...(được đào tạo, hỗ trợ chi phí);</p>\n</li>\n<li>\n<p>Trực nhà mẫu, dự án tư vấn trực tiếp cho khách hàng;</p>\n</li>\n<li>\n<p>Tìm hiểu, nghiên cứu thông tin dự án (đặc tính sản phẩm, tính pháp lý, giá cả, phương thức thanh toán, thủ tục bán hàng);</p>\n</li>\n<li>\n<p>Đàm phán, thương lượng với khách hàng về giá cả, hợp đồng, tiến hành chốt cọc và hỗ trợ khách hàng ký hợp đồng;</p>\n</li>\n<li>\n<p>Hỗ trợ giải đáp các vướng mắc, mong muốn của khách hàng sau khi giao dịch;</p>\n</li>\n<li>\n<p>Duy trì mối quan hệ tốt với các đối tác, khách hàng hiện tại và khách hàng tiềm năng;</p>\n</li>\n<li>\n<p>Thực hiện các công việc liên quan đến lĩnh vực kinh doanh theo chỉ đạo của cấp trên.</p>\n</li>\n</ul>\n<p>Yêu cầu ứng viên</p>\n<ul>\n<li>\n<p>Giao tiếp tốt, nhanh nhẹn, năng động, ham học hỏi, tác phong lịch sự, chuyên nghiệp;</p>\n</li>\n<li>\n<p>Không yêu cầu kinh nghiệm (ứng viên có kinh nghiệm Bán hàng, Kinh doanh, Kinh doanh Bất động sản, tài chính, ngân hàng, ô tô... là một lợi thế; các ứng viên chưa có kinh nghiệm sẽ được đào tạo các kỹ năng, nghiệp vụ bán hàng);</p>\n</li>\n<li>\n<p>Yêu thích kinh doanh và đam mê Bất động sản;</p>\n</li>\n<li>\n<p>Có kỹ năng thuyết phục, đàm phán, chốt giao dịch.</p>\n</li>\n<li>\n<p>Bộ phận Nhân sự sẽ liên hệ với ứng viên trong vòng 12h kể từ khi apply, ứng viên vui lòng chú ý điện thoại/ mail/ zalo để không bị miss thông tin.</p>\n</li>\n</ul>\n<p>Thu nhập\nThu nhập khi đạt 100% KPI: Từ 80 triệu VND trở lên\nThu nhập tính theo tỷ lệ đạt KPI\nLương cứng: Đến 12 triệu VND\nLương cứng không phụ thuộc doanh số</p>\n', 'Mô tả công việc\n- Tìm kiếm, khai thác khách hàng tiềm năng thông qua các kênh: Quảng cáo, Facebook, Website,...(được đào tạo, hỗ trợ chi phí);\n\n- Trực nhà mẫu, dự án tư vấn trực tiếp cho khách hàng;\n\n- Tìm hiểu, nghiên cứu thông tin dự án (đặc tính sản phẩm, tính pháp lý, giá cả, phương thức thanh toán, thủ tục bán hàng);\n\n- Đàm phán, thương lượng với khách hàng về giá cả, hợp đồng, tiến hành chốt cọc và hỗ trợ khách hàng ký hợp đồng;\n\n- Hỗ trợ giải đáp các vướng mắc, mong muốn của khách hàng sau khi giao dịch;\n\n- Duy trì mối quan hệ tốt với các đối tác, khách hàng hiện tại và khách hàng tiềm năng;\n\n- Thực hiện các công việc liên quan đến lĩnh vực kinh doanh theo chỉ đạo của cấp trên.\n\nYêu cầu ứng viên\n- Giao tiếp tốt, nhanh nhẹn, năng động, ham học hỏi, tác phong lịch sự, chuyên nghiệp;\n\n- Không yêu cầu kinh nghiệm (ứng viên có kinh nghiệm Bán hàng, Kinh doanh, Kinh doanh Bất động sản, tài chính, ngân hàng, ô tô... là một lợi thế; các ứng viên chưa có kinh nghiệm sẽ được đào tạo các kỹ năng, nghiệp vụ bán hàng);\n\n- Yêu thích kinh doanh và đam mê Bất động sản;\n\n- Có kỹ năng thuyết phục, đàm phán, chốt giao dịch.\n\n- Bộ phận Nhân sự sẽ liên hệ với ứng viên trong vòng 12h kể từ khi apply, ứng viên vui lòng chú ý điện thoại/ mail/ zalo để không bị miss thông tin.\n\nThu nhập\nThu nhập khi đạt 100% KPI: Từ 80 triệu VND trở lên\nThu nhập tính theo tỷ lệ đạt KPI\nLương cứng: Đến 12 triệu VND\nLương cứng không phụ thuộc doanh số', 'bat-dong-san', 'Đà Nẵng', '10-15tr', 3, 'giam-doc', 'fulltime', '2-nam', 'ca-hai'),
(52, 'Giáo Viên Tiếng Anh FullTime', '<p>Mô tả công việc\nGiảng dạy, luyện thi tiếng anh giao tiếp và IELTS cho lớp sĩ số nhỏ 1- 6 học viên theo giáo trình và lộ trình có sẵn bằng hình thức online Qua Zoom tại Văn phòng IELTS Mentor\nChấm bài, chữa bài tập về nhà cho học viên\nHỗ trợ &amp; đồng hành cùng học viên đạt mục tiêu đầu ra khóa học\nHọp và báo cáo định kỳ\nTham gia đào tạo, huấn luyện\nĐộ tuổi học viên: 16 - 25 tuổi.\nYêu cầu ứng viên\nCó chứng chỉ IELTS ≥ 7.0 (còn hạn)\nLàm full buổi tối từ thứ 2-7 (17h30-21h30), được nghỉ phép 1 buổi/ tháng\nLà sinh viên, đang chờ bằng hoặc đã tốt nghiệp Đại học\nTừ 1-3 tháng kinh nghiệm trợ giảng &amp; giảng dạy IELTS\nKỹ năng truyền đạt bài giảng dễ hiểu\nNhiệt tình, sát sao với học viên\nQuyền lợi\nThu nhập trung bình: Lương cứng 5.000.000đ - 7.000.000đ/tháng+ Thưởng dạy vượt lớp + Thưởng tháng</p>\n<p>(Mức lương cụ thể căn cứ vào bậc đánh giá đầu vào của Giáo viên được đánh giá sau phỏng vấn)</p>\n<p>Có cơ hội trở thành Giáo viên IELTS offline tại các cơ sở giảng dạy 12-18 học viên của Edutalk dạy tối với mức lương 20 - 30 triệu/tháng</p>\n', 'Mô tả công việc\nGiảng dạy, luyện thi tiếng anh giao tiếp và IELTS cho lớp sĩ số nhỏ 1- 6 học viên theo giáo trình và lộ trình có sẵn bằng hình thức online Qua Zoom tại Văn phòng IELTS Mentor\nChấm bài, chữa bài tập về nhà cho học viên\nHỗ trợ & đồng hành cùng học viên đạt mục tiêu đầu ra khóa học\nHọp và báo cáo định kỳ\nTham gia đào tạo, huấn luyện\nĐộ tuổi học viên: 16 - 25 tuổi.\nYêu cầu ứng viên\nCó chứng chỉ IELTS ≥ 7.0 (còn hạn)\nLàm full buổi tối từ thứ 2-7 (17h30-21h30), được nghỉ phép 1 buổi/ tháng\nLà sinh viên, đang chờ bằng hoặc đã tốt nghiệp Đại học\nTừ 1-3 tháng kinh nghiệm trợ giảng & giảng dạy IELTS\nKỹ năng truyền đạt bài giảng dễ hiểu\nNhiệt tình, sát sao với học viên\nQuyền lợi\nThu nhập trung bình: Lương cứng 5.000.000đ - 7.000.000đ/tháng+ Thưởng dạy vượt lớp + Thưởng tháng\n\n(Mức lương cụ thể căn cứ vào bậc đánh giá đầu vào của Giáo viên được đánh giá sau phỏng vấn)\n\nCó cơ hội trở thành Giáo viên IELTS offline tại các cơ sở giảng dạy 12-18 học viên của Edutalk dạy tối với mức lương 20 - 30 triệu/tháng', 'giao-vien', 'TP HCM', '10-15tr', 4, 'nhan-vien', 'fulltime', '2-nam', 'ca-hai'),
(53, 'Giáo Viên Toán Tiểu Học', '<p>Mô tả công việc\nGiảng dạy Toán cho học sinh lớp 2 đến lớp 5 trên phần mềm Classin\nMô hình lớp 1 giáo viên nhiều học sinh, sĩ số tối đa 6 học sinh, giảng dạy online qua phần mềm classin\nNhận xét, đánh giá học sinh sau mỗi buổi dạy\nThực hiện các công việc khác liên quan (nếu có)\nTham gia các buổi đào tạo trực tuyến, nâng cao kỹ năng sư phạm.\nYêu cầu ứng viên\nGiáo viên tiểu học, sinh viên đã tốt nghiệp hoặc đang chờ bằng có ít nhất 2 năm kinh nghiệm Gia sư cho học sinh tiểu học, THCS. Tốt nghiệp bằng Khá/ Giỏi/ XS chuyên ngành GD tiểu học, chuyên ngành Sư Phạm Toán các trường ĐHSP, ĐHKHTN, ĐHGD,.....\nHiểu rõ phương pháp giảng dạy và chương trình toán lớp 2 đến lớp 5.\nLàm việc tối thiểu 10 ca/tuần (60 phút/ca) các buổi tối thứ 2-chủ nhật, từ 19h-21h, đặc biệt có thể làm các ca tối trong tuần.\nCó máy tính đảm bảo kết nối Internet tốt, camera, mic tốt phục vụ cho việc giảng dạy trực tuyến.\nCó thể bắt đầu làm việc ngay khi kết thúc khóa đào tạo.\nCam kết gắn bó với lớp học và học sinh trong suốt khóa học.\nƯu tiên:</p>\n<ul>\n<li>Ứng viên có phương pháp giảng dạy sáng tạo, lôi cuốn tạo hứng thú cho học sinh.</li>\n<li>Ưu tiên những ứng viên đã có kinh nghiệm dạy class in, zoom, gg meet và các phần mềm E-Learning\nQuyền lợi\nMức lương: 130.000đ - 150.000đ/h (Thu nhập TB 8-20trđ/tháng) + nhiều chính sách thưởng hấp dẫn bao gồm\nThưởng Giáo viên xuất sắc nhất tháng\nThưởng Giáo viên chất lượng cao\nThưởng Giới thiệu giáo viên mới vào hệ thống\nĐăng ký theo lịch rảnh cá nhân\nCùng học sinh tạo ra các lớp học với trải nghiệm, đào tạo E-learning chuẩn thế kỷ 21 &quot;Đem thế giới vào lớp học và kết nối lớp học với cuộc sống&quot;\nĐược làm việc trong môi trường chuyên nghiệp và đội ngũ quản lý có kinh nghiệm và trình độ cao trong lĩnh vực giáo dục.\nEduca luôn tạo cơ hội để các bạn ham học hỏi và phát triển bản thân, đồng thời đánh giá công bằng năng lực của ứng viên.</li>\n</ul>\n', 'Mô tả công việc\nGiảng dạy Toán cho học sinh lớp 2 đến lớp 5 trên phần mềm Classin\nMô hình lớp 1 giáo viên nhiều học sinh, sĩ số tối đa 6 học sinh, giảng dạy online qua phần mềm classin\nNhận xét, đánh giá học sinh sau mỗi buổi dạy\nThực hiện các công việc khác liên quan (nếu có)\nTham gia các buổi đào tạo trực tuyến, nâng cao kỹ năng sư phạm.\nYêu cầu ứng viên\nGiáo viên tiểu học, sinh viên đã tốt nghiệp hoặc đang chờ bằng có ít nhất 2 năm kinh nghiệm Gia sư cho học sinh tiểu học, THCS. Tốt nghiệp bằng Khá/ Giỏi/ XS chuyên ngành GD tiểu học, chuyên ngành Sư Phạm Toán các trường ĐHSP, ĐHKHTN, ĐHGD,.....\nHiểu rõ phương pháp giảng dạy và chương trình toán lớp 2 đến lớp 5.\nLàm việc tối thiểu 10 ca/tuần (60 phút/ca) các buổi tối thứ 2-chủ nhật, từ 19h-21h, đặc biệt có thể làm các ca tối trong tuần.\nCó máy tính đảm bảo kết nối Internet tốt, camera, mic tốt phục vụ cho việc giảng dạy trực tuyến.\nCó thể bắt đầu làm việc ngay khi kết thúc khóa đào tạo.\nCam kết gắn bó với lớp học và học sinh trong suốt khóa học.\nƯu tiên:\n+ Ứng viên có phương pháp giảng dạy sáng tạo, lôi cuốn tạo hứng thú cho học sinh.\n+ Ưu tiên những ứng viên đã có kinh nghiệm dạy class in, zoom, gg meet và các phần mềm E-Learning\nQuyền lợi\nMức lương: 130.000đ - 150.000đ/h (Thu nhập TB 8-20trđ/tháng) + nhiều chính sách thưởng hấp dẫn bao gồm\nThưởng Giáo viên xuất sắc nhất tháng\nThưởng Giáo viên chất lượng cao\nThưởng Giới thiệu giáo viên mới vào hệ thống\nĐăng ký theo lịch rảnh cá nhân\nCùng học sinh tạo ra các lớp học với trải nghiệm, đào tạo E-learning chuẩn thế kỷ 21 \"Đem thế giới vào lớp học và kết nối lớp học với cuộc sống\"\nĐược làm việc trong môi trường chuyên nghiệp và đội ngũ quản lý có kinh nghiệm và trình độ cao trong lĩnh vực giáo dục.\nEduca luôn tạo cơ hội để các bạn ham học hỏi và phát triển bản thân, đồng thời đánh giá công bằng năng lực của ứng viên.', 'giao-vien', 'TP HCM', '10-15tr', 5, 'nhan-vien', 'fulltime', '2-nam', 'ca-hai'),
(54, 'Gia Sư Toán, Lý, Hoá, Văn, Sinh Cấp 2 Online', '<p>Mô tả công việc\nDạy một trong các môn Toán, Lý, Hoá, Văn, Sinh, Sử, Địa, Tiếng Anh, KHTN, KHXH cho học sinh cấp 2.\nDạy học theo hình thức 1:1 qua nền tảng trực tuyến theo chương trình có sẵn hoặc tùy biến theo mục tiêu học tập của học sinh.\nTheo dõi, đánh giá quá trình học tập và sự tiến bộ của học sinh.\nPhản hồi và hỗ trợ học sinh cải thiện kết quả học tập theo từng buổi.\nBáo cáo ngắn gọn về tình hình học tập của học sinh khi được yêu cầ\nYêu cầu ứng viên</p>\n<ul>\n<li>\n<p>Có chuyên môn vững, tinh thần trách nhiệm cao.</p>\n</li>\n<li>\n<p>Có thiết bị dạy online (máy tính, webcam, micro, đường truyền Internet ổn định).</p>\n</li>\n<li>\n<p>Môi trường giảng dạy yên tĩnh, phù hợp.</p>\n</li>\n<li>\n<p>Giao tiếp tốt, kiên nhẫn, có kỹ năng truyền đạt.</p>\n</li>\n</ul>\n<p>Quyền lợi\nThu nhập hấp dẫn, phụ thuộc số lượng buổi tham gia giảng dạy. Cụ thể:</p>\n<p>63.000đ/giờ: Dạy chương trình, kiến thức cơ bản, cải thiện điểm số, củng cố kiến thức trên lớp theo sách giáo khoa, ôn thi học kì.\n124.000đ/giờ: Dạy chương trình nâng cao, ôn thi học sinh giỏi, luyện thi vào lớp 6/lớp 10, thi THPT Quốc gia, đánh giá năng lực.</p>\n', 'Mô tả công việc\nDạy một trong các môn Toán, Lý, Hoá, Văn, Sinh, Sử, Địa, Tiếng Anh, KHTN, KHXH cho học sinh cấp 2.\nDạy học theo hình thức 1:1 qua nền tảng trực tuyến theo chương trình có sẵn hoặc tùy biến theo mục tiêu học tập của học sinh.\nTheo dõi, đánh giá quá trình học tập và sự tiến bộ của học sinh.\nPhản hồi và hỗ trợ học sinh cải thiện kết quả học tập theo từng buổi.\nBáo cáo ngắn gọn về tình hình học tập của học sinh khi được yêu cầ\nYêu cầu ứng viên\n- Có chuyên môn vững, tinh thần trách nhiệm cao.\n\n- Có thiết bị dạy online (máy tính, webcam, micro, đường truyền Internet ổn định).\n\n- Môi trường giảng dạy yên tĩnh, phù hợp.\n\n- Giao tiếp tốt, kiên nhẫn, có kỹ năng truyền đạt.\n\nQuyền lợi\nThu nhập hấp dẫn, phụ thuộc số lượng buổi tham gia giảng dạy. Cụ thể:\n\n63.000đ/giờ: Dạy chương trình, kiến thức cơ bản, cải thiện điểm số, củng cố kiến thức trên lớp theo sách giáo khoa, ôn thi học kì.\n124.000đ/giờ: Dạy chương trình nâng cao, ôn thi học sinh giỏi, luyện thi vào lớp 6/lớp 10, thi THPT Quốc gia, đánh giá năng lực.', 'giao-vien', 'TP HCM', '10-15tr', 10, 'nhan-vien', 'fulltime', '2-nam', 'ca-hai'),
(55, 'Team Leader Marketing', '<p>Mô tả công việc\nQuản lý và điều phối hoạt động của team Marketing (Digital, Content, Design, PR...).\nLên kế hoạch, tổ chức và giám sát các chiến dịch Digital Marketing đa kênh: Online (Facebook, Google Ads, SEO...)\nTheo dõi hiệu quả chiến dịch, phân tích dữ liệu, tối ưu ngân sách và báo cáo KPIs.\nLàm việc chặt chẽ với các phòng ban liên quan (Sales, CSKH...) để đảm bảo mục tiêu chung.\nĐào tạo và phát triển đội ngũ nhân viên trong team.\nYêu cầu ứng viên\nTốt nghiệp chuyên ngành Marketing, Truyền thông, Kinh tế hoặc các ngành liên quan.\nTối thiểu 2 năm kinh nghiệm ở vị trí tương đương hoặc Senior Marketing Executive.\nCó kinh nghiệm quản lý team từ 2-5 người trở lên.\nHiểu biết sâu về Digital Marketing (SEO, Facebook Ads, Google Ads, Email...).\nKỹ năng phân tích dữ liệu, lập kế hoạch và quản lý ngân sách.\nGiao tiếp tốt, tư duy phản biện, có tinh thần trách nhiệm cao.\nQuyền lợi\nLương: [12-15tr] + Thưởng KPIs + Phụ cấp.\nCơ hội phát triển lên vị trí Marketing Manager.\nLàm việc trong môi trường trẻ trung, sáng tạo, đề cao sự chủ động.\nTham gia đầy đủ BHXH, BHYT, BHTN.\nDu lịch team-building, quà sinh nhật, thưởng lễ tết...</p>\n', 'Mô tả công việc\nQuản lý và điều phối hoạt động của team Marketing (Digital, Content, Design, PR...).\nLên kế hoạch, tổ chức và giám sát các chiến dịch Digital Marketing đa kênh: Online (Facebook, Google Ads, SEO...)\nTheo dõi hiệu quả chiến dịch, phân tích dữ liệu, tối ưu ngân sách và báo cáo KPIs.\nLàm việc chặt chẽ với các phòng ban liên quan (Sales, CSKH...) để đảm bảo mục tiêu chung.\nĐào tạo và phát triển đội ngũ nhân viên trong team.\nYêu cầu ứng viên\nTốt nghiệp chuyên ngành Marketing, Truyền thông, Kinh tế hoặc các ngành liên quan.\nTối thiểu 2 năm kinh nghiệm ở vị trí tương đương hoặc Senior Marketing Executive.\nCó kinh nghiệm quản lý team từ 2-5 người trở lên.\nHiểu biết sâu về Digital Marketing (SEO, Facebook Ads, Google Ads, Email...).\nKỹ năng phân tích dữ liệu, lập kế hoạch và quản lý ngân sách.\nGiao tiếp tốt, tư duy phản biện, có tinh thần trách nhiệm cao.\nQuyền lợi\nLương: [12-15tr] + Thưởng KPIs + Phụ cấp.\nCơ hội phát triển lên vị trí Marketing Manager.\nLàm việc trong môi trường trẻ trung, sáng tạo, đề cao sự chủ động.\nTham gia đầy đủ BHXH, BHYT, BHTN.\nDu lịch team-building, quà sinh nhật, thưởng lễ tết...', 'digitalmarketing', 'TP HCM', '10-15tr', 3, 'nhan-vien', 'fulltime', '2-nam', 'nam-post'),
(56, 'Chuyên Viên Digital Marketing', '<p>Mô tả công việc</p>\n<ul>\n<li>\n<p>Chạy quảng cáo Facebook/TikTok/Google Ads (tối ưu CPC, tăng ROAS).</p>\n</li>\n<li>\n<p>Phân tích data từ Google Analytics, Meta Business Suite.</p>\n</li>\n<li>\n<p>Hỗ trợ tìm kiếm khách hàng xuất khẩu qua Alibaba, LinkedIn/Email marketing ... để tìm kiếm khách hàng xuất khẩu</p>\n</li>\n<li>\n<p>Phối hợp với Content Creator để tạo hình ảnh, video.</p>\n</li>\n</ul>\n<p>Yêu cầu ứng viên</p>\n<ul>\n<li>\n<p>Tốt nghiệp Cao đẳng/Đại học chuyên ngành Marketing, Truyền thông, Thương mại điện tử hoặc liên quan.</p>\n</li>\n<li>\n<p>Sử dụng thành thạo các công cụ AI cho digital marketing</p>\n</li>\n<li>\n<p>Có ít nhất 2 năm kinh nghiệm trong lĩnh vực Digital Marketing. ưu tiên ứng viên có kinh nghiệm chạy marketing online xuất khẩu trong ngành thực phẩm hoặc FMCG, portfolio chiến dịch thành công.</p>\n</li>\n<li>\n<p>Thành thạo các công cụ chạy quảng cáo: Facebook Ads, Google Ads, TikTok Ads,...</p>\n</li>\n<li>\n<p>Biết sử dụng các công cụ phân tích như Google Analytics, Meta Business Suite, v.v.</p>\n</li>\n<li>\n<p>Tư duy sáng tạo, nắm bắt xu hướng tốt.</p>\n</li>\n<li>\n<p>Kỹ năng làm việc nhóm và làm việc độc lập tốt. Ưu tiên người có kinh nghiệm về xuất khẩu.\nQuyền lợi</p>\n</li>\n<li>\n<p>Lương: 12tr- 15tr ( tùy năng lực)</p>\n</li>\n<li>\n<p>Thưởng các ngày lễ tết trong năm</p>\n</li>\n<li>\n<p>Thưởng Quý</p>\n</li>\n<li>\n<p>Chế độ đãi ngộ tốt và theo luật định.</p>\n</li>\n<li>\n<p>Thời gian làm việc : từ 7h30 đến 17h, nghỉ giữa giờ 1,5 tiếng, nghỉ Chủ nhật và các ngày lễ theo quy định nhà nước.</p>\n</li>\n</ul>\n', 'Mô tả công việc\n- Chạy quảng cáo Facebook/TikTok/Google Ads (tối ưu CPC, tăng ROAS).\n\n- Phân tích data từ Google Analytics, Meta Business Suite.\n\n- Hỗ trợ tìm kiếm khách hàng xuất khẩu qua Alibaba, LinkedIn/Email marketing ... để tìm kiếm khách hàng xuất khẩu\n\n- Phối hợp với Content Creator để tạo hình ảnh, video.\n\nYêu cầu ứng viên\n- Tốt nghiệp Cao đẳng/Đại học chuyên ngành Marketing, Truyền thông, Thương mại điện tử hoặc liên quan.\n\n- Sử dụng thành thạo các công cụ AI cho digital marketing\n\n- Có ít nhất 2 năm kinh nghiệm trong lĩnh vực Digital Marketing. ưu tiên ứng viên có kinh nghiệm chạy marketing online xuất khẩu trong ngành thực phẩm hoặc FMCG, portfolio chiến dịch thành công.\n\n- Thành thạo các công cụ chạy quảng cáo: Facebook Ads, Google Ads, TikTok Ads,...\n\n- Biết sử dụng các công cụ phân tích như Google Analytics, Meta Business Suite, v.v.\n\n- Tư duy sáng tạo, nắm bắt xu hướng tốt.\n\n- Kỹ năng làm việc nhóm và làm việc độc lập tốt. Ưu tiên người có kinh nghiệm về xuất khẩu.\nQuyền lợi\n- Lương: 12tr- 15tr ( tùy năng lực)\n\n- Thưởng các ngày lễ tết trong năm\n\n- Thưởng Quý\n\n- Chế độ đãi ngộ tốt và theo luật định.\n\n- Thời gian làm việc : từ 7h30 đến 17h, nghỉ giữa giờ 1,5 tiếng, nghỉ Chủ nhật và các ngày lễ theo quy định nhà nước.', 'digitalmarketing', 'TP HCM', '10-15tr', 5, 'nhan-vien', 'fulltime', '2-nam', 'nam-post'),
(57, 'Nhân Viên Marketing Tổng Hợp', '<p>Mô tả công việc\nNhân viên marketing có kinh nghiệm, đam mê và quan tâm đến các lĩnh vực:</p>\n<p>Sáng tạo nội dung content, kịch bản video, tổ chức sự kiện, hoạt náo minigame. Có kinh nghiệm làm việc phối hợp với Designer, Media và Video Editor, Digital Ads. Chủ động thực hiện các công tác truyền thông nội bộ, sáng tạo kết nối các phòng ban.\nSử dụng thành thạo các thiết bị quay chụp, flycam, setup ánh sáng, bố cục. Thực hiện quay chụp sự kiện, dự án, nhân sự công ty. Cập nhật hình ảnh, video tiến độ các dự án và có kỹ năng edit video tạo hiệu ứng VFX, sound effects\nDựng phim và chỉnh sửa video chất lượng cao: Edit video với hiệu ứng VFX, sound effects tốt, dựng phim quảng cáo, giới thiệu, video ngắn cho các nền tảng, có kinh nghiệm dựng video sự kiện và bất động sản, sử dụng thành thạo các phần mềm chuyên dụng.\nTriển khai quảng cáo số hiệu quả: Chạy quảng cáo đa nền tảng, nắm vững thuật toán, xây dựng kế hoạch nội dung quảng cáo, phân tích số liệu và đề xuất cải thiện.\nThiết kế hình ảnh sáng tạo: Thiết kế hình ảnh quảng cáo, hỗ trợ phát triển ý tưởng concept cho các dự án marketing và content online để thu hút khách hàng, lên ý tưởng video quảng cáo, thiết kế nội dung kênh truyền thông và cập nhật xu hướng thiết kế.\nYêu cầu ứng viên\nTối thiểu 02 năm kinh nghiệm.\nƯu tiên có các chứng chỉ chuyên môn về Digital Marketing, Quảng cáo số, Truyền thông tích hợp (ví dụ: Google Ads, Meta Blueprint, HubSpot, v.v.).\nĐam mê công việc marketing, ham học hỏi và sẵn sàng khám phá các xu hướng mới.\nLinh hoạt làm việc độc lập hoặc làm việc theo nhóm.\nQuyền lợi\nLương: 12-17 triệu/tháng, thỏa thuận theo năng lực\nPhụ cấp theo KPI: Từ 2-5tr/tháng\nReview lương 1 năm/lần\nĐược hưởng đầy đủ các chính sách bảo hiểm y tế, bảo hiểm xã hội theo quy định\nTham gia Teambuiding công ty</p>\n', 'Mô tả công việc\nNhân viên marketing có kinh nghiệm, đam mê và quan tâm đến các lĩnh vực:\n\nSáng tạo nội dung content, kịch bản video, tổ chức sự kiện, hoạt náo minigame. Có kinh nghiệm làm việc phối hợp với Designer, Media và Video Editor, Digital Ads. Chủ động thực hiện các công tác truyền thông nội bộ, sáng tạo kết nối các phòng ban.\nSử dụng thành thạo các thiết bị quay chụp, flycam, setup ánh sáng, bố cục. Thực hiện quay chụp sự kiện, dự án, nhân sự công ty. Cập nhật hình ảnh, video tiến độ các dự án và có kỹ năng edit video tạo hiệu ứng VFX, sound effects\nDựng phim và chỉnh sửa video chất lượng cao: Edit video với hiệu ứng VFX, sound effects tốt, dựng phim quảng cáo, giới thiệu, video ngắn cho các nền tảng, có kinh nghiệm dựng video sự kiện và bất động sản, sử dụng thành thạo các phần mềm chuyên dụng.\nTriển khai quảng cáo số hiệu quả: Chạy quảng cáo đa nền tảng, nắm vững thuật toán, xây dựng kế hoạch nội dung quảng cáo, phân tích số liệu và đề xuất cải thiện.\nThiết kế hình ảnh sáng tạo: Thiết kế hình ảnh quảng cáo, hỗ trợ phát triển ý tưởng concept cho các dự án marketing và content online để thu hút khách hàng, lên ý tưởng video quảng cáo, thiết kế nội dung kênh truyền thông và cập nhật xu hướng thiết kế.\nYêu cầu ứng viên\nTối thiểu 02 năm kinh nghiệm.\nƯu tiên có các chứng chỉ chuyên môn về Digital Marketing, Quảng cáo số, Truyền thông tích hợp (ví dụ: Google Ads, Meta Blueprint, HubSpot, v.v.).\nĐam mê công việc marketing, ham học hỏi và sẵn sàng khám phá các xu hướng mới.\nLinh hoạt làm việc độc lập hoặc làm việc theo nhóm.\nQuyền lợi\nLương: 12-17 triệu/tháng, thỏa thuận theo năng lực\nPhụ cấp theo KPI: Từ 2-5tr/tháng\nReview lương 1 năm/lần\nĐược hưởng đầy đủ các chính sách bảo hiểm y tế, bảo hiểm xã hội theo quy định\nTham gia Teambuiding công ty', 'digitalmarketing', 'TP HCM', '10-15tr', 6, 'nhan-vien', 'fulltime', '2-nam', 'nam-post'),
(58, 'Quản Lý Kinh Doanh Quốc Tế', '<p>Mô tả công việc\nNghiên cứu thị trường quốc tế.\nTìm kiếm, tiếp cận và phát triển khách hàng và thị trường.\nXây dựng chiến lược kinh doanh (kế hoạch kinh doanh, chính sách giá, chính sách khuyến mãi và phương án phân phối).\nTư vấn thông tin, kỹ thuật sản phẩm; xử lý khiếu nại khách hàng (nếu có).\nQuản lý quy trình bán hàng quốc tế.\nBáo cáo và phân tích thị trường và kết quả kinh doanh.\nYêu cầu ứng viên\nTrình độ học vấn: Đại học trở lên chuyên ngành Kinh tế, Kinh doanh quốc tế, Quản trị kinh doanh, hoặc liên quan.\nKinh nghiệm: Tối thiểu 3-5 năm kinh nghiệm trong lĩnh vực kinh doanh quốc tế, ưu tiên ngành vật liệu xây dựng, kính, hoặc sản phẩm công nghiệp tương tự.\nNgoại ngữ: Tiếng Anh thành thạo (giao tiếp, đàm phán, viết email, xử lý hợp đồng); Biết thêm tiếng Trung là một lợi thế.\nKỹ năng: Đàm phán và thương lượng. Am hiểu về xuất nhập khẩu, logistics quốc tế, Incoterms.\nQuyền lợi\nMức lương: Thoả thuận theo năng lực ứng viên và cạnh tranh tốt so với thị trường.\nCác chế độ phụ cấp, phúc lợi theo Quy định chung của Tập đoàn và Công ty.\nHỗ trợ suất ăn giữa ca.\nĐược hưởng đầy đủ các chế độ BHXH, BHYT, BHTN theo quy định pháp luật.</p>\n', 'Mô tả công việc\nNghiên cứu thị trường quốc tế.\nTìm kiếm, tiếp cận và phát triển khách hàng và thị trường.\nXây dựng chiến lược kinh doanh (kế hoạch kinh doanh, chính sách giá, chính sách khuyến mãi và phương án phân phối).\nTư vấn thông tin, kỹ thuật sản phẩm; xử lý khiếu nại khách hàng (nếu có).\nQuản lý quy trình bán hàng quốc tế.\nBáo cáo và phân tích thị trường và kết quả kinh doanh.\nYêu cầu ứng viên\nTrình độ học vấn: Đại học trở lên chuyên ngành Kinh tế, Kinh doanh quốc tế, Quản trị kinh doanh, hoặc liên quan.\nKinh nghiệm: Tối thiểu 3-5 năm kinh nghiệm trong lĩnh vực kinh doanh quốc tế, ưu tiên ngành vật liệu xây dựng, kính, hoặc sản phẩm công nghiệp tương tự.\nNgoại ngữ: Tiếng Anh thành thạo (giao tiếp, đàm phán, viết email, xử lý hợp đồng); Biết thêm tiếng Trung là một lợi thế.\nKỹ năng: Đàm phán và thương lượng. Am hiểu về xuất nhập khẩu, logistics quốc tế, Incoterms.\nQuyền lợi\nMức lương: Thoả thuận theo năng lực ứng viên và cạnh tranh tốt so với thị trường.\nCác chế độ phụ cấp, phúc lợi theo Quy định chung của Tập đoàn và Công ty.\nHỗ trợ suất ăn giữa ca.\nĐược hưởng đầy đủ các chế độ BHXH, BHYT, BHTN theo quy định pháp luật.', 'kinh-te', 'Đà Nẵng', '3-5tr', 200, 'nhan-vien', 'fulltime', '2-nam', 'nu-post'),
(59, 'Nhân Viên Phân Tích Số Liệu', '<p>Mô tả công việc</p>\n<ol>\n<li>\n<p>Thu thập và xử lý dữ liệu: Thu thập, làm sạch và tổ chức dữ liệu từ các nguồn khác nhau để đảm bảo dữ liệu chính xác và có thể sử dụng được.</p>\n</li>\n<li>\n<p>Phân tích dữ liệu: Sử dụng các công cụ phân tích để khám phá và phân tích dữ liệu nhằm tìm ra các xu hướng, mô hình và thông tin hữu ích.</p>\n</li>\n<li>\n<p>Tạo báo cáo: Phát triển và trình bày các báo cáo phân tích, bảng điều khiển và trực quan hóa dữ liệu để hỗ trợ quyết định kinh doanh.</p>\n</li>\n<li>\n<p>Hợp tác với các phòng ban: Làm việc chặt chẽ với các bộ phận khác như marketing, bán hàng và sản phẩm để hiểu nhu cầu và cung cấp thông tin phân tích cần thiết.</p>\n</li>\n<li>\n<p>Cải tiến quy trình: Đề xuất các giải pháp cải tiến dựa trên phân tích dữ liệu để tối ưu hóa hoạt động và kết quả kinh doanh.</p>\n</li>\n<li>\n<p>Theo dõi và đánh giá KPI: Theo dõi các chỉ số hiệu suất chính (KPI) và đánh giá hiệu quả của các chiến lược và chương trình.</p>\n</li>\n</ol>\n<p>Yêu cầu ứng viên</p>\n<ol>\n<li>\n<p>Không phân biệt giới tính. Độ tuổi: 1986 trở về sau</p>\n</li>\n<li>\n<p>Kinh nghiệm: &gt;=5 năm ở vị trí ứng tuyển</p>\n</li>\n<li>\n<p>Kỹ năng sử dụng MS Office (Word, Excel, PowerPoint, Forms...) và kỹ năng sử dụng Google (Google worksheet, Google Docs, Google Presentation,...)</p>\n</li>\n<li>\n<p>Tiếng Anh: giao tiếp lưu loát là 1 lợi thế</p>\n</li>\n<li>\n<p>Hòa nhập nhanh, khả năng chịu áp lực cao, làm việc trách nhiệm</p>\n</li>\n</ol>\n<p>Quyền lợi</p>\n<ol>\n<li>\n<p>Thưởng các dịp lễ Tết; Thưởng theo kết quả kinh doanh hàng tháng/quý/năm.</p>\n</li>\n<li>\n<p>Hỗ trợ 100% chi phí ăn uống.</p>\n</li>\n<li>\n<p>Thường xuyên đi công tác ngắn hạn/dài hạn trong &amp; ngoài nước. Hỗ trợ 100% chi phí thuê căn hộ khi đi công tác (ăn uống/khách sạn)</p>\n</li>\n<li>\n<p>Ngày phép hàng tháng: 06 hoặc 07 ngày phép mỗi tháng (tùy vào level/vị trí)</p>\n</li>\n<li>\n<p>Chế độ du lịch/nghỉ mát hàng năm.</p>\n</li>\n<li>\n<p>Hỗ trợ 100% chi phí các khóa học nâng cao kiến thức chuyên môn liên quan đến công việc (Khi nhân viên có yêu cầu). Không yêu cầu bồi hoàn chi phí đào tạo khi nghỉ việc</p>\n</li>\n<li>\n<p>Môi trường Chuyên nghiệp - Năng động - Công bằng - Nhân văn</p>\n</li>\n</ol>\n', 'Mô tả công việc\n1. Thu thập và xử lý dữ liệu: Thu thập, làm sạch và tổ chức dữ liệu từ các nguồn khác nhau để đảm bảo dữ liệu chính xác và có thể sử dụng được.\n\n2. Phân tích dữ liệu: Sử dụng các công cụ phân tích để khám phá và phân tích dữ liệu nhằm tìm ra các xu hướng, mô hình và thông tin hữu ích.\n\n3. Tạo báo cáo: Phát triển và trình bày các báo cáo phân tích, bảng điều khiển và trực quan hóa dữ liệu để hỗ trợ quyết định kinh doanh.\n\n4. Hợp tác với các phòng ban: Làm việc chặt chẽ với các bộ phận khác như marketing, bán hàng và sản phẩm để hiểu nhu cầu và cung cấp thông tin phân tích cần thiết.\n\n5. Cải tiến quy trình: Đề xuất các giải pháp cải tiến dựa trên phân tích dữ liệu để tối ưu hóa hoạt động và kết quả kinh doanh.\n\n6. Theo dõi và đánh giá KPI: Theo dõi các chỉ số hiệu suất chính (KPI) và đánh giá hiệu quả của các chiến lược và chương trình.\n\nYêu cầu ứng viên\n1. Không phân biệt giới tính. Độ tuổi: 1986 trở về sau\n\n2. Kinh nghiệm: >=5 năm ở vị trí ứng tuyển\n\n3. Kỹ năng sử dụng MS Office (Word, Excel, PowerPoint, Forms...) và kỹ năng sử dụng Google (Google worksheet, Google Docs, Google Presentation,...)\n\n4. Tiếng Anh: giao tiếp lưu loát là 1 lợi thế\n\n5. Hòa nhập nhanh, khả năng chịu áp lực cao, làm việc trách nhiệm\n\nQuyền lợi\n1. Thưởng các dịp lễ Tết; Thưởng theo kết quả kinh doanh hàng tháng/quý/năm.\n\n2. Hỗ trợ 100% chi phí ăn uống.\n\n3. Thường xuyên đi công tác ngắn hạn/dài hạn trong & ngoài nước. Hỗ trợ 100% chi phí thuê căn hộ khi đi công tác (ăn uống/khách sạn)\n\n4. Ngày phép hàng tháng: 06 hoặc 07 ngày phép mỗi tháng (tùy vào level/vị trí)\n\n5. Chế độ du lịch/nghỉ mát hàng năm.\n\n6. Hỗ trợ 100% chi phí các khóa học nâng cao kiến thức chuyên môn liên quan đến công việc (Khi nhân viên có yêu cầu). Không yêu cầu bồi hoàn chi phí đào tạo khi nghỉ việc\n\n7. Môi trường Chuyên nghiệp - Năng động - Công bằng - Nhân văn', 'kinh-te', 'Đà Nẵng', '10-15tr', 200, 'nhan-vien', 'fulltime', '1-nam', 'nam-post'),
(60, 'Luật Sư Tư Vấn - Tranh Tụng', '<p>Mô tả công việc</p>\n<ul>\n<li>\n<p>Tư vấn các quy định pháp luật về tranh chấp và giải quyết tranh chấp trong các vụ án dân sự, kinh doanh thương mại hoặc/và vụ án hình sự;</p>\n</li>\n<li>\n<p>Tiếp nhận hồ sơ, nghiên cứu phương án, tham gia giải quyết các vụ án dân sự, kinh doanh thương mại hoặc/và vụ án hình sự;</p>\n</li>\n<li>\n<p>Tham gia các hoạt động thương lượng, đàm phán với các chủ thể tranh chấp; đại diện làm việc với các cơ quan, tổ chức, cá nhân có liên quan; đại diện bảo vệ quyền lợi của khách hàng trong các giai đoạn tố tụng tại Toà án, Trọng tài;</p>\n</li>\n<li>\n<p>Thực hiện các nhiệm vụ chung của Công ty.</p>\n</li>\n</ul>\n<p>Yêu cầu ứng viên</p>\n<ul>\n<li>\n<p>Có tư duy logic, khả năng hùng biện, kỹ năng soạn thảo văn bản tốt; có khả năng giải quyết công việc độc lập;</p>\n</li>\n<li>\n<p>Sử dụng thành thạo tin học văn phòng;</p>\n</li>\n<li>\n<p>Có kinh nghiệm tư vấn tranh tụng tối thiểu 05 năm kể từ thời điểm được cấp thẻ luật sư trong các lĩnh vực dân sự, kinh doanh thương mại; hình sự;</p>\n</li>\n<li>\n<p>Ưu tiên các ứng viên có kinh nghiệm tư vấn dự án, làm việc trong các Công ty Bất động sản;</p>\n</li>\n<li>\n<p>Ưu tiên các ứng viên có trình độ ngoại ngữ (tiếng Anh/Trung).</p>\n</li>\n</ul>\n<p>Quyền lợi</p>\n<ul>\n<li>\n<p>Lương, thưởng theo năng lực;</p>\n</li>\n<li>\n<p>Được đóng BHXH, BHYT, BHTN;</p>\n</li>\n<li>\n<p>Môi trường làm việc chuyên nghiệp, năng động;</p>\n</li>\n<li>\n<p>Nhiều cơ hội phát triển năng lực, trình độ chuyên môn; được đào tạo, nâng cao kỹ năng nghề thường xuyên;</p>\n</li>\n<li>\n<p>Chế độ phúc lợi khác theo quy định của công ty: Lương tháng thứ 13, lương ngày phép; thưởng lễ, tết; thưởng theo vụ việc; nghỉ mát hàng năm; đào tạo bồi dưỡng nâng cao nghiệp vụ và trang thiết bị làm việc chuyên nghiệp, hiện đại, ...</p>\n</li>\n</ul>\n', 'Mô tả công việc\n- Tư vấn các quy định pháp luật về tranh chấp và giải quyết tranh chấp trong các vụ án dân sự, kinh doanh thương mại hoặc/và vụ án hình sự;\n\n- Tiếp nhận hồ sơ, nghiên cứu phương án, tham gia giải quyết các vụ án dân sự, kinh doanh thương mại hoặc/và vụ án hình sự;\n\n- Tham gia các hoạt động thương lượng, đàm phán với các chủ thể tranh chấp; đại diện làm việc với các cơ quan, tổ chức, cá nhân có liên quan; đại diện bảo vệ quyền lợi của khách hàng trong các giai đoạn tố tụng tại Toà án, Trọng tài;\n\n- Thực hiện các nhiệm vụ chung của Công ty.\n\nYêu cầu ứng viên\n- Có tư duy logic, khả năng hùng biện, kỹ năng soạn thảo văn bản tốt; có khả năng giải quyết công việc độc lập;\n\n- Sử dụng thành thạo tin học văn phòng;\n\n- Có kinh nghiệm tư vấn tranh tụng tối thiểu 05 năm kể từ thời điểm được cấp thẻ luật sư trong các lĩnh vực dân sự, kinh doanh thương mại; hình sự;\n\n- Ưu tiên các ứng viên có kinh nghiệm tư vấn dự án, làm việc trong các Công ty Bất động sản;\n\n- Ưu tiên các ứng viên có trình độ ngoại ngữ (tiếng Anh/Trung).\n\nQuyền lợi\n- Lương, thưởng theo năng lực;\n\n- Được đóng BHXH, BHYT, BHTN;\n\n- Môi trường làm việc chuyên nghiệp, năng động;\n\n- Nhiều cơ hội phát triển năng lực, trình độ chuyên môn; được đào tạo, nâng cao kỹ năng nghề thường xuyên;\n\n- Chế độ phúc lợi khác theo quy định của công ty: Lương tháng thứ 13, lương ngày phép; thưởng lễ, tết; thưởng theo vụ việc; nghỉ mát hàng năm; đào tạo bồi dưỡng nâng cao nghiệp vụ và trang thiết bị làm việc chuyên nghiệp, hiện đại, ...', 'luat', 'TP HCM', '10-15tr', 200, 'nhan-vien', 'fulltime', '2-nam', 'nam-post');
INSERT INTO `detailposts` (`id`, `name`, `descriptionHTML`, `descriptionMarkdown`, `categoryJobCode`, `addressCode`, `salaryJobCode`, `amount`, `categoryJoblevelCode`, `categoryWorktypeCode`, `experienceJobCode`, `genderPostCode`) VALUES
(61, 'Chuyên Viên Tố Tụng Tòa Án', '<p>Mô tả công việc\nChuyên môn Chuyên viên xử lý nợ\nNgân hàng\nTài chính\nLuật / Pháp chế\nThực hiện hoạt động tham gia tố tụng tại các cơ quan tiến hành tố tụng (tòa án, viện kiểm soát, thi hành án) tại từng địa bàn bao gồm:</p>\n<p>Tiếp nhận hồ sơ các khoản nợ của khách hàng được Lãnh đạo giao để xử lý;\nXác minh thông tin liên quan đến thẩm quyền tòa án thụ lý hồ sơ.\nTham gia tố tụng (làm việc trực tiếp với Tòa án, Thi hành án, Viện Kiểm soát) với tư cách người được ủy quyền trong vụ án mà VPBank là nguyên đơn/Bị đơn/người có quyền lợi nghĩa vụ liên quan.\nQuản lý hồ sơ và thực hiện công tác báo cáo về công tác tố tụng định kỳ và đột xuất theo yêu cầu của lãnh đạo.\nTham gia vào các buổi họp thường xuyên về lập kế hoạch công việc, vận hành và rà soát hiệu quả công việc trong nhóm.\nCác công việc và nghiệp vụ khác theo yêu cầu của lãnh đạo.\nYêu cầu ứng viên\nƯu tiên Tốt nghiệp Cao đẳng/Đại học các chuyên ngành Luật.\nCó tối thiểu 01 năm kinh nghiệm về tư vấn giải quyết các tranh chấp quan hệ dân sự liên quan đến vay nợ, thế chấp tài sản.\nAm hiểu các quy định Pháp luật liên quan đến hoạt động thu hồi nợ, có các mối quan hệ tốt với tòa án, thi hành án, có kỹ năng giao tiếp, đàm phán, thương lượng.\nCó khả năng làm việc dưới áp lực cao. Xử lý tình huống linh hoạt.\nCó sức khoẻ tốt, chịu khó.\nGiọng nói rõ ràng, dứt khoát.\nSử dụng cơ bản các ứng dụng tin học văn phòng Word, Excel, Outlook, ...\nƯu tiên:\nCó chứng chỉ đào tạo nghiệp vụ luật sư và kinh nghiệm tham gia tố tụng; hoặc\nCó kinh nghiệm làm xử lý nợ tại các AMC, Ngân hàng, Công ty thu hồi nợ;\nChủ động, sáng tạo và luôn tìm tòi cải tiến trong công việc;\nKiên nhẫn, quyết đoán, nhạy bén và chịu được áp lực công việc cao;\nSử dụng thành thạo các ứng dụng tin học văn phòng;\nHiểu biết về đời sống xã hội, tình hình kinh tế, thị trường, khách hàng;\nQuyền lợi được hưởng\nMức thu nhập hấp dẫn và cạnh tranh trong ngành Ngân hàng và Dịch vụ tài chính. Lương thỏa thuận phù hợp theo quy định của VPBank tuỳ theo năng lực/ hiệu quả làm việc + thưởng theo tháng/ quý/ năm.\nCác khoá đào tạo kỹ năng, chuyên môn nghiệp vụ, kiến thức chuyên ngành (đào tạo nội bộ, hỗ trợ chi phí cho các khoá ngắn hạn bên ngoài).\nMôi trường làm việc năng nộng, cơ hội thăng tiến (đánh giá hiệu quả làm việc 2 lần/năm, xem xét điều chỉnh lương định kỳ 1 lần/năm).\nTham gia các hoạt động Văn Thể Mỹ của Công ty và Ngân hàng: Hội thao VPBank - bóng đá, tennis, cầu lông, AOE...; Cuộc thi Sing &amp; Dance; Thi Trạng Nguyên; các chuyến đi tình nguyện, ...\nĐảm bảo các quyền lợi theo quy định của pháp luật, chế độ phúc lợi hấp dẫn cho nhân viên của Ngân hàng VPBank: du lịch thường niên, miễn phí dịch vụ ngân hàng, vay ưu đãi, bảo hiểm sức khoẻ PVI, ...</p>\n', 'Mô tả công việc\nChuyên môn Chuyên viên xử lý nợ\nNgân hàng\nTài chính\nLuật / Pháp chế\nThực hiện hoạt động tham gia tố tụng tại các cơ quan tiến hành tố tụng (tòa án, viện kiểm soát, thi hành án) tại từng địa bàn bao gồm: \n\nTiếp nhận hồ sơ các khoản nợ của khách hàng được Lãnh đạo giao để xử lý;\nXác minh thông tin liên quan đến thẩm quyền tòa án thụ lý hồ sơ.\nTham gia tố tụng (làm việc trực tiếp với Tòa án, Thi hành án, Viện Kiểm soát) với tư cách người được ủy quyền trong vụ án mà VPBank là nguyên đơn/Bị đơn/người có quyền lợi nghĩa vụ liên quan.\nQuản lý hồ sơ và thực hiện công tác báo cáo về công tác tố tụng định kỳ và đột xuất theo yêu cầu của lãnh đạo.\nTham gia vào các buổi họp thường xuyên về lập kế hoạch công việc, vận hành và rà soát hiệu quả công việc trong nhóm.\nCác công việc và nghiệp vụ khác theo yêu cầu của lãnh đạo.\nYêu cầu ứng viên\nƯu tiên Tốt nghiệp Cao đẳng/Đại học các chuyên ngành Luật.\nCó tối thiểu 01 năm kinh nghiệm về tư vấn giải quyết các tranh chấp quan hệ dân sự liên quan đến vay nợ, thế chấp tài sản.\nAm hiểu các quy định Pháp luật liên quan đến hoạt động thu hồi nợ, có các mối quan hệ tốt với tòa án, thi hành án, có kỹ năng giao tiếp, đàm phán, thương lượng.\nCó khả năng làm việc 